window.bookSummaryJSON = "<p>It’s the $10 million heist you’ve never heard of. In a matter of months, dozens of truckloads disappeared from American highways. But what were they carrying? Nuts.&nbsp;</p> <p>Marc Fennell takes you into a rabbit hole of crime syndicates, stolen identities and private investigators that will change the way you think about food forever. Eighty per cent of the world’s almonds are grown in the heart of California, but this journey will take you to Italy, the Spanish coast, deep under the earth and even into space.&nbsp;</p> <p>A Somethin' Else production for Audible Originals.</p>"; 
